CREATE OR REPLACE PROCEDURE check_subscription_expiry_2f1301c3()
LANGUAGE plpgsql
AS $$
BEGIN
PERFORM net.http_post(
url:=current_setting('app.supabase_url') || '/functions/v1/check-subscription-expiry',
headers:=jsonb_build_object('Content-Type', 'application/json'),
body:='{"edge_function_name":"check-subscription-expiry"}',
timeout_milliseconds:=10000
);
COMMIT;
END;
$$;

SELECT cron.schedule('check-subscription-expiry_invoke', '0 0 * * *', 'CALL check_subscription_expiry_2f1301c3()');
